import React, { Component } from "react"

export default class Dog extends Component {
    state = {
        allPups: []
    }

    displayPupNames = () => {
        fetch("http://localhost:3000/pups")
            .then(resp => resp.json())
            .then(pups => {
                this.setState({ allPups: pups })
            })
        console.log(this.state.allPups)
    }


    render() {
        return (
            this.displayPupNames

        )

    }
}
